db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5deb723616c2ad315f2d02a5"), ObjectId("5de8138110322c613229c52a"), ObjectId("5deb724e16c2ad315f2d02ab") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8db2acc446376c1110e83"), ObjectId("5de8db47cc446376c1110e84") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5dfd2bc211451162dbc26632"), contentType: 'NEWS', title: 'Asasi za kiraia za Tanzania na China zakubali kushirikiana', description: 'Serikali ya China kupitia Ubalozi wake nchini umeingia makubaliano na asasi saba za kiraia huku mlengo mkubwa wa makubaliano hayo ukiwa ni kushirikiana na wanajamii ikiwa ni pamoja na kubadilisha uzoefu na teknolojia ili kuweza kujenga uchumi imara kwa wanajamii pamoja na kupunguza umaskini. \n\nAkizungumza katika hafla hiyo Spika wa Bunge, Job Ndugai amesema kuwa, viongozi wa asasi hizo zisizo za Kiserikali kutoka Tanzania na China watashirikiana katika kuleta maendeleo kupitia nyanja mbalimbali ikiwemo kubadilishana uzoefu na teknolojia sambamba na kuwashirikisha wananchi katika fursa mbalimbali za kiuchumi.\n\nSpika Ndugai amesema kuwa mpango huo ni wa muda mrefu ambao Rais wa nchi hiyo, Xi Jinping aliuanza mwaka 2003, Rais Jinping alianzisha ushirikiano huo ili kuleta maendeleo ya pamoja na hiyo ikiwa sambamba na uimarishaji wa miundombinu, biashara ya pamoja na mahusiano bora ya wanajamii. \n\nAmesema kuwa Tanzania na China wamekuwa ndugu Sasa kutokana na kuwa na urafiki na ushirikiano uliobora zaidi; Ndugai amezishauri Ofisi za Balozi za Mataifa hayo mawili kutoa ushirikiano wa kutosha ili malengo ya yaliyowekwa ikiwemo kupunguza umaskini, kubadilishana uzoefu hasa teknolojia na kutoa fursa kwa wananchi kushiriki katika shughuli za kiuchumi kupitia asasi za kiraia yalete mafanikio makubwa. \n\nKwa upande wake Naibu Spika wa Bunge la Jumuiya wa watu wa China na kiongozi mkubwa wa Chama cha Communist nchini humo, Ji Bingxuan amesema kuwa mahusiano hayo ambayo yana zaidi ya miaka 50 sasa yalijengwa na waasisi wa mataifa hayo na matunda ya misingi hiyo yanashuhudiwa sasa.\n\nSpika Bingxuan amesema kuwa uhusiano wa Tanzania na China ni wa kipekee huku akitolea mfano kwa Waziri Mkuu Mstaafu, Dkt. Salim Ahmed Salim kuwa kiongozi wa kwanza kutoka Bara la Afrika kutunukiwa tuzo heshima ya kuwa na kuimarisha mahusiano baina ya mataifa hayo mawili.\n\nNaye Balozi wa China nchini, Wang Ke amesema kuwa fursa hizo zitawanufaisha wanajamii wa nchi hizo kupitia asasi hizo za kiraia na kuleta maendeleo ya pamoja. Wang Ke amesema kuwa mwaka 2013 Rais Xi Jinping aliichagua Tanzania kuwa nchi ya kwanza kuitembelea mara tu alipochaguliwa na kadri miaka inavyokwenda wameshuhudia namna mahusiano hayo yanavyozidi kuwa imara na tija kwa wananchi wa mataifa hayo.\n\nMbali na taasisi zinazohusika na masuala ya wanawake na afya moja ya asasi iliyoingia makubaliano hayo ya kuleta maendeleo ya pamoja kwa wanajamii wa China na Tanzania ni Taasisi ya Maafa, Majanga na Uokoaji (SUKOS) iliyochini ya Mstaafu, Kamanda wa Polisi Kanda maalumu ya Dar es Salaam Suleiman Kova.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/CHINA_1576858577-945bb62574ee8e0648a4b0bc2f97c223.jpg', series: [], referenceChannelID: null, createdAt: new Date("Fri, 20 Dec 2019 20:14:58 GMT"), updatedAt: new Date("Fri, 20 Dec 2019 20:14:58 GMT"), __v: 0 }, { session: null })
