db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5e007da4934d06633efbe754") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d283"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8dbedcc446376c1110ebd") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e007e4111451162dbc26873"), contentType: 'NEWS', title: 'Takumi Minamino: Liverpool sign Red Bull Salzburg midfielder', description: 'Liverpool have confirmed the signing of Japan attacking midfielder Takumi Minamino from Austrian club Red Bull Salzburg.\n\nThe 24-year-old underwent a medical and agreed personal terms with the Premier League leaders on Wednesday after they triggered his £7.25m release clause.\n\nMinamino, who will wear the No 18 shirt, told the Liverpool website: "It has been a dream, my dream to become a Liverpool player. And I\'m so excited that the moment has come true.\n\n"To play in the Premier League was one of my targets. I think this is the top-class league in the world; I was thinking if my career as a footballer progressed smoothly, someday I would be able to play in the Premier League.\n\n"But I never thought I would be able to play in this team and I\'m really happy about it. I\'m looking forward to it."\n\nIt is understood Jurgen Klopp has been impressed by how Michael Edwards, the club\'s sporting director, and football operations team secured Minamino\'s signing, in terms of good relationship with RB Salzburg.\n\n"This is fabulous news - a wonderful signing. We are really, really happy about this," Klopp added."Takumi is a very quick, very clever player, he finds space between the lines. He is brave with the ball but also brave without the ball - a proper team player. He makes the best of himself for the benefit of others.\n\n"It\'s not hard to see why Salzburg is a favoured destination for players with real talent and hunger.\n\n"From our experiences dealing with, and facing, Salzburg on and off the pitch in recent months, their reputation as a benchmark modern European club will only grow."\n\nMinamino impressed against Liverpool in the Champions League this season, scoring at Anfield as Salzburg finished third behind the Reds and Napoli to qualify for the Europa League. He has also registered five goals and six assists in the Austrian Bundesliga this season for league leaders Salzburg.\n', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/MINAMINO_1576820656-ee751d68e97eaba1bfe042846aeb89a3.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 08:43:45 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 08:43:45 GMT"), __v: 0 }, { session: null })
db.searchcontentmodels.insertOne({ _id: ObjectId("5e007e4111451162dbc26874"), contentId: ObjectId("5e007e4111451162dbc26873"), name: 'Takumi Minamino: Liverpool sign Red Bull Salzburg midfielder|Liverpool have confirmed the signing of Japan attacking midfielder Takumi Minamino from Austrian club Red Bull Salzburg.\n\nThe 24-year-old underwent a medical and agreed personal terms with the Premier League leaders on Wednesday after they triggered his £7.25m release clause.\n\nMinamino, who will wear the No 18 shirt, told the Liverpool website: "It has been a dream, my dream to become a Liverpool player. And I\'m so excited that the moment has come true.\n\n"To play in the Premier League was one of my targets. I think this is the top-class league in the world; I was thinking if my career as a footballer progressed smoothly, someday I would be able to play in the Premier League.\n\n"But I never thought I would be able to play in this team and I\'m really happy about it. I\'m looking forward to it."\n\nIt is understood Jurgen Klopp has been impressed by how Michael Edwards, the club\'s sporting director, and football operations team secured Minamino\'s signing, in terms of good relationship with RB Salzburg.\n\n"This is fabulous news - a wonderful signing. We are really, really happy about this," Klopp added."Takumi is a very quick, very clever player, he finds space between the lines. He is brave with the ball but also brave without the ball - a proper team player. He makes the best of himself for the benefit of others.\n\n"It\'s not hard to see why Salzburg is a favoured destination for players with real talent and hunger.\n\n"From our experiences dealing with, and facing, Salzburg on and off the pitch in recent months, their reputation as a benchmark modern European club will only grow."\n\nMinamino impressed against Liverpool in the Champions League this season, scoring at Anfield as Salzburg finished third behind the Reds and Napoli to qualify for the Europa League. He has also registered five goals and six assists in the Austrian Bundesliga this season for league leaders Salzburg.\n|News|Entertainment|Sports|', __v: 0 }, { session: null })
db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5de80f6110322c613229c502") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d283"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8db0ccc446376c1110e7c") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e00830a11451162dbc2687b"), contentType: 'NEWS', title: 'Eskom crisis: Arrests over $50m South Africa power station \'fraud\'', description: 'Two former managers at Eskom, South Africa\'s ailing power firm, have been arrested for alleged corruption and fraud worth 745m rand ($51m; £39m).\n\nProsecutors said an investigation had revealed "gross manipulation" of contracts related to the construction of two new large power stations.\n\nTwo business directors and seven companies are also due in court in connection with the case.\n\nOfficials said the accused must remain unnamed until they appeared in court.\n\nIn a statement, Eskom said: "Eskom continues to work with law enforcement agencies... to root out corruption and malfeasance."\n\nThe firm added that it would "leave no stone unturned in ensuring that perpetrators" were "brought to book".\n\nSouth Africa\'s Special Investigating Unit, which was also looking into the allegations, said the arrests were "a great milestone in the fight against corruption in our country".\n\nEskom is one of the biggest power utilities in the world, providing 90% of supply in South Africa, the most industrialised country in Africa.\n\nThe firm generates almost all its electricity from coal, an abundant resource in South Africa. \n\nHowever, it has also been plagued by a number of mismanagement and corruption scandals over the years, which have contributed to its serious financial issues.\n\nLast week, after the country\'s biggest power outage in more than a decade, the state-owned firm had to implement some of the most far-reaching planned blackouts in years.\n\nScheduled blackouts are designed to prevent a total collapse of an overstretched power grid. Similar measures were put in place in February this year, as well as in 2018, 2015 and 2008.\n\nRatings agencies often cite the country\'s frequent power outages as one of the main risks to the South African economy.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/ESKOM_1576819389-d8a3d63dd2214b1efc9fa2ad1cceebb5.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 09:04:10 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 09:04:10 GMT"), __v: 0 }, { session: null })
