db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5de80f6110322c613229c502") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8db0ccc446376c1110e7c") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e00853911451162dbc26881"), contentType: 'NEWS', title: 'Zambia suspends 15pc export duty on gemstones: Minister', description: 'Zambia will suspend a 15 per cent export duty on gemstones but not diamonds from January 1 after the move that was intended to raise more revenues instead undermined production, the finance minister said on Thursday.\n\nBwalya Ng’andu told Reuters the suspension of the export duty, announced in the official gazette on Friday, was a concession to miners after the upfront tax had hurt output.\n\n“The industry was bleeding and production was falling,” he said by telephone.\n\nThe export duty still applies to diamonds.\n\nSouth African gemstone miner Gemfields Group Ltd, which had seen its profits hit by the duty, welcomed the suspension of the duty, which had been one issue in a broader row with the mining industry about tax rates.\n\nAfrica’s second-largest copper producer has tried to levy higher taxes on the miners, a key part of its economy, as it grapples with high levels of debt and low growth.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/Zambia-gemstones-84d0feee03842d889f0a6900247a08e6.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 09:13:29 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 09:13:29 GMT"), __v: 0 }, { session: null })
